<p>当我们访问使用某个Web认证热点访问某个HTTP网站，网关会对这个<a href="https://so.csdn.net/so/search?q=HTTP%E5%93%8D%E5%BA%94&amp;spm=1001.2101.3001.7020" target="_blank" rel="noreferrer">HTTP响应</a>报文劫持并纂改302重定向给我们一个web认证界面。网关（或者说交换机）都默认放行DHCP（用于分配IP）和DNS（用于劫持用户数据报）。</p>
